#include <iostream>


using namespace std;

#define INDEX(c) ((int)c - (int)'a')


class TrieNode {
public:
    // Initialize your data structure here.
      	
    TrieNode* children[26];
    bool isleaf;
    TrieNode(bool b=false) {
        //use to fill in the memory space
        memset(children, NULL, sizeof(children));
        isleaf = b;
    }
};

class Trie {
public:
    Trie() {
        root = new TrieNode();
    }

    // Inserts a word into the trie.
    void insert(string word) {
        //insert a new tri node into the tri

    	start = root;

        for(char c : word){
            cout << c << endl;
        	if (!start -> children[INDEX(c)]){
        		start -> children[INDEX(c)] = new TrieNode();
        	}
        	start = start->children[INDEX(c)];
        }
        start -> isleaf = true;
    }

    // Returns if the word is in the trie.
    bool search(string word) {
        
        start = root;
        for(char c : word){
        	if (start != NULL) start = start->children[INDEX(c)];
        }
        return start->isleaf && start;

    }

    // Returns if there is any word in the trie
    // that starts with the given prefix.
    bool startsWith(string prefix) {
    	start = root;
        for(char c : prefix){
        	if (start != NULL) start = start->children[INDEX(c)];
        }
        return start;
    }



private:
    TrieNode* root;
    TrieNode* start;
};





